import React from "react";
import aboutPolicy from "../imgs/aboutLogo.jpg";
import styled from "styled-components";

const AboutPolicyPage = () => {
    return (
        <Container>
            <CCContainer>
                <BigAboutContainer>
                    <AboutContainer>
                        <TopAboutContainer>
                            <ImageContainer>
                                <img src={aboutPolicy} alt="About Image" />
                                <OverlayTextContainer>
                                    <OverlayTextTop>
                                        <h2>우리의 생각</h2>
                                    </OverlayTextTop>
                                    <OverlayTextBottom>
                                        <h2>Policy</h2>
                                    </OverlayTextBottom>
                                </OverlayTextContainer>
                            </ImageContainer>
                        </TopAboutContainer>
                        <BottomAboutContainer>
                            <BottomCenterContainer>
                                <br />
                                <h2>매번,</h2>
                                <h2>마음과 조건이 듬뿍 담긴 서비스입니다.<br /><br /></h2>
                                <h2>마음과 조건이 듬뿍 담긴 서비스입니다.<br /><br /></h2><h2>마음과 조건이 듬뿍 담긴 서비스입니다.<br /><br /></h2><h2>마음과 조건이 듬뿍 담긴 서비스입니다.<br /><br /></h2>


                            </BottomCenterContainer>
                            <TextContainer>
                                <h2>대표. 한소연 일동</h2>
                            </TextContainer>
                        </BottomAboutContainer>
                    </AboutContainer>
                </BigAboutContainer>
            </CCContainer>
        </Container>
    )
}

const Container = styled.div`
  position: absolute;
  width: 100%;
  justify-content: center;
  height: 100vh;
  margin: auto;
  display: grid;
  grid-template-columns: 1fr; /* Single column for the entire container */
  grid-template-rows: auto 1fr auto auto; /* Four rows for BigAboutContainer, FeatureContainer, FlowContainer, and SocialContainer */
`;

const BigAboutContainer = styled.div`
  display: flex;
  grid-template-columns: 1fr;
  grid-template-rows: auto 1fr; /* Adjust rows as needed */
  height: 70vh; /* Change height to auto for responsiveness */
  justify-content: center;
  align-items: center;
  margin-top: 4rem;
  width: 90%;
  border-radius: 10% 10% 0 0 / 10% 10% 0 0; /* 부드러운 흐물한 효과를 위한 border-radius 설정 */
`;

const AboutContainer = styled.div`
  display: flex;
  flex-direction: column;
  width: 100%; /* Change width to 100% for responsiveness */
  max-width: 1200px; /* Add max-width for responsiveness */
`;
const CCContainer = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
`
const TopAboutContainer = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  flex: 5.5;
`;

const ImageContainer = styled.div`
  display: flex;
  position: relative;
  flex: 1;
  justify-content: center;
  align-items: center;
  width: 100%;
  height: 50%;
  img {
    width: 100%;
    height: 300px;
    max-width: 100%; /* Ensure the image does not exceed its natural size */
    border-radius: 10% 10% 0 0 / 10% 10% 0 0; /* 부드러운 흐물한 효과를 위한 border-radius 설정 */
  }
`;
const OverlayTextContainer = styled.div`
  position: absolute;
  justify-content: center;
  width: 100%;
  height: 200px;
  display: flex;
  flex-direction: column;
  padding: 20px;
  top: 50%; /* 부모 요소의 50% 높이에서 정렬 시작 */
  transform: translateY(-50%); /* 부모 요소의 50% 높이만큼 위로 이동 */
`;

const OverlayTextTop = styled.div`
  border-radius: 5px;
  text-align: center;

  h2 {
    font-size: 32px;
    font-weight: 700;
    color: white;
  }
`;
const TextContainer = styled.div`
  display: flex;
  width: 100%;
  justify-content: flex-end;
  background-color: #FBCEB1;
  h2 {
    margin-right: 5rem;
    font-weight: 600;
  }
`
const OverlayTextBottom = styled.div`
  border-radius: 5px;
  text-align: center;

  h2 {
    font-size: 28px;
    font-weight: 600;
    color: white;
  }
`;

const BottomAboutContainer = styled.div`
  display: flex;
  flex: 1;
  flex-direction: column;
  justify-content: center;
  background-color: #FBCEB1;
`;

const BottomCenterContainer = styled.div`
  display: flex;
  flex: 1;
  background-color: #FBCEB1;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  margin-top: 1rem;
  border-radius: 5px;
  border: 2px solid #FBCEB1;

  h2 {
    font-size: 36px;
    color: orange;
    font-weight: 700;
  }
  h3 {
    font-size: 20px;
  }
`;

export default AboutPolicyPage;
